params.value:
query pathLastCommit($projectPath: ID!, $path: String, $ref: String!) {
  project(fullPath: $projectPath) {
    repository {
      tree(path: $path, ref: $ref) {
        lastCommit {
          sha
          title
          titleHtml
          description
          message
          webUrl
          authoredDate
          authorName
          authorGravatar
          author {
            name
            avatarUrl
            webUrl
            __typename
          }
          signatureHtml
          pipelines(ref: $ref, first: 1) {
            edges {
              node {
                detailedStatus {
                  detailsPath
                  icon
                  tooltip
                  text
                  group
                  __typename
                }
                __typename
              }
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

