query getPermissions($projectPath: ID!) {
  project(fullPath: $projectPath) {
    userPermissions {
      pushCode
      forkProject
      createMergeRequestIn
      __typename
    }
    __typename
  }
}

fragment TreeEntry on Entry {
  id
  sha
  name
  flatPath
  type
  __typename
}

query getFiles($projectPath: ID!, $path: String, $ref: String!, $pageSize: Int!, $nextPageCursor: String, $vueLfsEnabled: Boolean = false) {
  project(fullPath: $projectPath) {
    repository {
      tree(path: $path, ref: $ref) {
        trees(first: $pageSize, after: $nextPageCursor) {
          edges {
            node {
              ...TreeEntry
              webUrl
              __typename
            }
            __typename
          }
          pageInfo {
            ...PageInfo
            __typename
          }
          __typename
        }
        submodules(first: $pageSize, after: $nextPageCursor) {
          edges {
            node {
              ...TreeEntry
              webUrl
              treeUrl
              __typename
            }
            __typename
          }
          pageInfo {
            ...PageInfo
            __typename
          }
          __typename
        }
        blobs(first: $pageSize, after: $nextPageCursor) {
          edges {
            node {
              ...TreeEntry
              webUrl
              lfsOid @include(if: $vueLfsEnabled)
              __typename
            }
            __typename
          }
          pageInfo {
            ...PageInfo
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment PageInfo on PageInfo {
  hasNextPage
  endCursor
  __typename
}

