          edges {
            node {
              ...TreeEntry
              webUrl
              lfsOid @include(if: $vueLfsEnabled)
              __typename
            }
            __typename
          }
          pageInfo {
            ...PageInfo
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
